  }
  return (
    <>

    <div className={`slide-panel ${isOpen ? 'open' : ''}`} onClick={togglePanel}>
      <div className="panel-content">
      <div className='Profile-card-panel'>
        <div className='alignprofilecard'>
          <div className='Profileincard'></div>
        </div>  
